import React, { Component } from "react";
import { MDBContainer, MDBRow, MDBCol, MDBInput } from "mdbreact";
import "./HomePge.css";
import { NavLink } from "react-router-dom";
class HomePage extends Component {
  handleDefault = e => {
    e.preventDefault();
  };
  muFunction = () => {
    const check = document.getElementById("myInput");
    const x = document.getElementById("sh");
    if (check.type === "password") {
      check.type = "text";
    } else {
      check.type = "password";
    }
  };
  render() {
    return (
      <div className="container-home">
        {/*Form with header*/}
        <div className="card_form card_opacity">
          <MDBContainer>
            <MDBRow>
              <MDBCol md="12">
                <form onSubmit={this.handleDefault}>
                  <div className="form-header">
                    <h2>
                      <i class="fa fa-lock"></i> Login
                    </h2>
                  </div>
                  <div className="purple-text form_input">
                    <MDBInput
                      label="Type your email"
                      icon="envelope"
                      group
                      type="email"
                      validate
                      error="wrong"
                      success="right"
                    />
                    <MDBInput
                      label="Type your password"
                      icon="lock"
                      group
                      type="password"
                      validate
                    />
                    \{" "}
                    <MDBInput
                      label="Address"
                      size="lg"
                      icon="fa fa-map-marker"
                      onChange={this.handleChangeInput}
                    />
                    <MDBInput
                      label="Phone Number"
                      size="lg"
                      type="number"
                      icon="fa fa-phone-square"
                      onChange={this.handleChangeInput}
                    />
                    <MDBInput
                      label="Email"
                      size="lg"
                      type="email"
                      icon="fa fa-envelope"
                      onChange={this.handleChangeInput}
                    />

                  </div>

                  <button className="btn btn-success">Login</button>
                  <NavLink to="/">
                    {" "}
                    <button className="btn btn-danger sign_up sign_up">
                      Sign Up
                    </button>
                  </NavLink>
                </form>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </div>
      </div>
    );
  }
}

export default HomePage;
